pragma solidity >=0.4.21 <0.6.0;

import "./Deps/DateTime.sol";


//NOTE: we are using different function for QR code generation ,different mapping ,etc because , 
//for file code we are using FILE HASH as main element and for folder code we are using FOLDER ADDRESS

contract deps is DateTime 
{ 

  /**
   * @dev struture to store File transfer related information
   */
    struct FileProof
    {
        address sender;
        address receiver;
        bytes32 fileHash;
        uint256 timestamp;
        bytes32 QR;
        bytes32 QRTime;
    }
  /**
   * @dev structure to store Folder transfer related information
   */
    struct FolderProof
    {
        address sender;
        address receiver;
        address folderAddress;
        uint256 timestamp;
        bytes32 QR;
        bytes32 QRTime;
    }

    struct FileQRWithIndex
    {
        bytes32 hashFile;
        uint256 index;
    }

    struct FolderQRWithIndex
    {
        address folderAddress;
        uint256 index;
    }

  /**
   * @dev mapping to map the proof and QR codes(both with and Without time)
   * @mapping fileProofs , map the struct of file proof with file hash as its key
   * @mapoing folderProofs , map the struct of folder proof with folder hash as its key
   * @mapping fileQrCodeWithoutTime , map the QR code with file  hash as key . It helps in searching proof via QR
   * @mapping fileQrCodeWithTime , map the QR code with Time with file hash as key   
   * @mapping folderQrCodeWithoutTime , map the QR code with folder address as key . It helps in searching proof via QR
   * @mapping folderQrCodeWithTime , map the QR code with Time with folder address as key   
   */
    mapping (bytes32 => FileProof[]) public fileProofs; // this allows to look up proof of transfer by the hashfile
    mapping (address => FolderProof[]) public folderProofs;
    mapping (bytes32 => FileQRWithIndex[]) public fileQrCodeWithoutTime; //  QrCode => hashFile
    mapping (bytes32 => FileQRWithIndex[]) public fileQrCodeWithTime;
    mapping (bytes32 => FolderQRWithIndex[]) public folderQrCodeWithoutTime; //  QrCode => hashFile
    mapping (bytes32 => FolderQRWithIndex[]) public folderQrCodeWithTime;

    mapping(bytes32 => bool) public usedFileHashes;
    mapping(address => bool) public usedFolderAddresses;






    function _createFileTransferProof(address _sender, address _receiver, bytes32 _fileHash,uint256 time, bytes32 QRWithNoTime ,bytes32 QRWithTime) public returns (bool)
    {
        FileProof memory currentInfo;
        currentInfo.sender = _sender;
        currentInfo.receiver = _receiver;
        currentInfo.fileHash = _fileHash;
        currentInfo.timestamp = time;
        currentInfo.QR = QRWithNoTime;
        currentInfo.QRTime = QRWithNoTime;
        fileProofs[_fileHash].push(currentInfo);
        uint256 index = fileProofs[_fileHash].length - 1;
        FileQRWithIndex memory indexInfo;
        indexInfo.hashFile = _fileHash;
        indexInfo.index = index;
        fileQrCodeWithoutTime[QRWithNoTime].push(indexInfo);
        fileQrCodeWithTime[QRWithTime].push(indexInfo);
        usedFileHashes[_fileHash] = true;
        return true;
    }

    function _createFolderTransferProof(address _sender,address _receiver,address _folderAddress,uint256 time,bytes32 QRWithNoTime,bytes32 QRWithTime) public returns(bool)
    {
        FolderProof memory currentInfo;
        currentInfo.sender = _sender;
        currentInfo.receiver = _receiver;
        currentInfo.folderAddress = _folderAddress;
        currentInfo.timestamp = time;
        currentInfo.QR = QRWithNoTime;
        currentInfo.QRTime = QRWithNoTime;
        folderProofs[_folderAddress].push(currentInfo); // if the entry is already present in mapping with same folder address then it add the info in the array of struct "FolderProof" mapped to the specific address , And if not present then creates the new entry
        uint256 index = folderProofs[_folderAddress].length - 1;
        FolderQRWithIndex memory indexInfo;
        indexInfo.folderAddress = _folderAddress;
        indexInfo.index = index;
        folderQrCodeWithoutTime[QRWithNoTime].push(indexInfo);
        folderQrCodeWithTime[QRWithTime].push(indexInfo);
        usedFolderAddresses[_folderAddress] = true;
        return true;
    }

