    */


function _getFileTransferProofsAllSendersAndReceivers(bytes32 fileHash , uint256 len) internal view returns (address[] memory, address[] memory)
{
      address[] memory allSenders = new address[](len);
      address[] memory allReceivers = new address[](len);
      for(uint256 i = 0 ; i<len ; i++)
        {
            allSenders[i] = fileProofs[fileHash][i].sender;
            allReceivers[i] = fileProofs[fileHash][i].receiver;
        }
        return (allSenders , allReceivers);    

}

function  _getFileTransferProofsQR(bytes32 fileHash , uint256 len) internal view returns (bytes32 [] memory)
{
  bytes32[] memory allQRs = new bytes32[](len);
  for(uint256 i = 0 ; i<len ; i++)
        {
           allQRs[i] = fileProofs[fileHash][i].QR;
        }
        return allQRs; 

}

function _getFileTransferProofsQRTime(bytes32 fileHash ,uint256 len) internal view returns (bytes32 [] memory)
{
  bytes32[] memory allQRs = new bytes32[](len);
  for(uint256 i = 0 ; i<len ; i++)
        {
           allQRs[i] = fileProofs[fileHash][i].QRTime;
        }
        return allQRs; 


}

    /**
   * @dev calculates the day , month , year using the timestamp
   * @param time , timestamp whose day,month,year is to be calculated 
   */
    function getDateTime (uint256 time) internal pure returns(uint256,uint256,uint256)
      {
        uint256 year = getYear(time);
        uint256 month = getMonth(time);
        uint256 day = getDay(time);
        return (year, month, day );
    }

    function _getFileTransferProofsDateTime(bytes32 fileHash ,uint256 len) internal view returns (uint256[] memory , uint256[] memory , uint256 [] memory)
  {
     uint256[] memory allDays = new uint256[](len);
        uint256[] memory allMonths = new uint256[](len);
        uint256[] memory allYears = new uint256[](len);
    for(uint256 i = 0 ; i<len ; i++)
        {
            uint256 time = fileProofs[fileHash][i].timestamp; 
            (uint256 year, uint256 month, uint256 day) = getDateTime(time);
            allDays[i] = day;
            allMonths[i] = month;
            allYears[i] = year;
        }
        return (allDays, allMonths, allYears);
    }



  function _getFolderTransferProofsAllSenderAndReceivers(address folderAddress,uint256 len) internal view returns(address[] memory , address[] memory)
  {
      address[] memory allSenders = new address[](len);
        address[] memory allReceivers = new address[](len);
        for(uint256 i = 0 ; i<len ; i++)
        {
            allSenders[i] = folderProofs[folderAddress][i].sender;
            allReceivers[i] = folderProofs[folderAddress][i].receiver;
        }
        return (allSenders, allReceivers);
  }


  function _getFolderTransferProofsAllQR(address folderAddress,uint256 len) internal view returns (bytes32[] memory)
  {
    bytes32[] memory allQRs = new bytes32[](len);
        for(uint256 i = 0 ; i<len ; i++)
        {
           allQRs[i] = folderProofs[folderAddress][i].QR;
        }
        return (allQRs);

        }

  function _getFolderTransferProofsAllQRTime(address folderAddress,uint256 len) internal view returns(bytes32[] memory)
  {

   bytes32[] memory allQRs = new bytes32[](len);
        for(uint256 i = 0 ; i<len ; i++)
        {
           allQRs[i] = folderProofs[folderAddress][i].QRTime;
        }
        return (allQRs);

        }
  function _getFolderTransferProofsDateTime(address folderAddress ,uint256 len) internal view returns (uint256[] memory , uint256[] memory , uint256 [] memory)
  {
    uint256[] memory allDays = new uint256[](len);
        uint256[] memory allMonths = new uint256[](len);
        uint256[] memory allYears = new uint256[](len);
    for(uint256 i = 0 ; i<len ; i++)
        {
            uint256 time = folderProofs[folderAddress][i].timestamp; 
            (uint256 year, uint256 month, uint256 day) = getDateTime(time);
            allDays[i] = day;
            allMonths[i] = month;
            allYears[i] = year;
        }
        return (allDays, allMonths, allYears);
    }

}
